import React, { Component } from "react";
import "./featured.css";

class Featured extends Component {
  state = {};
  render() {
    console.log(this.props);
    return (
      <div className="featured" {...this.props.addStyle}>
        <div className="container">{this.props.children}</div>
      </div>
    );
  }
}

export default Featured;
